export function add07(a: number, b: number): number {
  return a + b;
}

export function subtract07(a: number, b: number): number {
  return a - b;
}

export function multiply07(a: number, b: number): number {
  return a * b;
}

export function divide07(a: number, b: number): number {
  return a / b;
}
